import * as http from "./util/HttpClient";
import {useEffect} from "react";
import Container from "./Container";

function App() {
  useEffect(() => {
    console.log('ddd')
    getStockRecommendList()
  }, [])

  function getStockRecommendList() {
    const url = `http://localhost:8080/api/stock/recommend/list`
    const method = 'post'
    const data = {
      "featureStockUid": 0,
      "listCnt": 0,
      "pubAnnounceUid": 0,
      "recStockUid": 0,
      "searchKeyword": "string",
      "startIndex": 0,
      "themeStockUid": 0,
      "userLevel": "string"
    }
    console.log(url)
    const response = http.request(url, method, data)
    console.log(response)
  }

  return (
    <div className="App">
      <Container />
    </div>
  );
}

export default App;
